import React from 'react';

function Languages() {
  return (
    <div className="languages">
      <h1>Language</h1>
      <div className="languageitem">
        <h3><strong>English | Proficient</strong></h3>
        <ul>
            <li>TOEIC (950/990), OPIc (IH)</li>
        </ul>
      </div>
      <div className="languageitem">
      <h3><strong>Korean | Native</strong></h3>
      </div>
    </div>
  );
}

export default Languages;
